script: |
  super -f text -I q9256.spq | sort > q9256.out

inputs:
  - name: q9256.spq
    data: |
      SELECT DISTINCT ( col2 ) + + col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + - 70 * 73 * - col0 < ( + col1 );
  - name: tab0

outputs:
  - name: q9256.out
    data: |
      100
      128
      31
